n      // console.log('AbstractCacheService.cacheMiss', key);\n      const cacheMiss = this.getValue(key);\n      this.cache.set(key, cacheMiss);\n      return cacheMiss;\n    }\n  }\n\n  protected abstract getValue(key: string): Promise;\n\n}\n\n    \n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"directives/AbstractCamera.html":{"url":"directives/AbstractCamera.html","title":"directive - AbstractCamera","body":"\n                   \n\n\n\n\n\n\n\n  Directives\n  AbstractCamera\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            projects/atft/src/lib/camera/abstract-camera.ts\n        \n\n\n\n            \n                Implements\n            \n            \n                            OnInit\n                            OnChanges\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                camera\n                            \n                        \n                    \n                \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                    Protected\n                                applyPosition\n                            \n                            \n                                    Protected\n                                applyZAxisUp\n                            \n                            \n                                    Protected\n                                    Abstract\n            